import React, { Component } from 'react'


export class Admin extends Component {
    render() {
        return (
            <div>
               <div class="col-md-12 col-sm-12 " id="general">
                    <div className="panel-content">
                        <svg width="440px" height="440px" viewBox="0 0 440 440" stroke="red" xmlns="www.w3.org/svg" >
                            <circle cx="150" cy="150" r="140" />
                        </svg>
                    </div>
                </div>
            </div>
        )
    }
}

export default Admin;
